-- Function to get all weapons
function WeaponsDB:GetAllWeapons()
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" then
            table.insert(weapons, weapon)
        end
    end
    return weapons
end

-- Function to get weapons by quality
function WeaponsDB:GetWeaponsByQuality(quality)
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" and weapon.quality == quality then
            -- Add item ID and quality color to weapon data
            local weaponWithId = {}
            for k, v in pairs(weapon) do
                weaponWithId[k] = v
            end
            weaponWithId.item_id = itemId
            weaponWithId.quality_color = qualityColors[weapon.quality] or qualityColors[0]
            table.insert(weapons, weaponWithId)
        end
    end
    return weapons
end

-- Function to get weapons by subclass
function WeaponsDB:GetWeaponsBySubclass(subclass)
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" and weapon.subclass == subclass then
            -- Add item ID and quality color to weapon data
            local weaponWithId = {}
            for k, v in pairs(weapon) do
                weaponWithId[k] = v
            end
            weaponWithId.item_id = itemId
            weaponWithId.quality_color = qualityColors[weapon.quality] or qualityColors[0]
            table.insert(weapons, weaponWithId)
        end
    end
    return weapons
end

-- Function to get TBC weapons
function WeaponsDB:GetTBCWeapons()
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" and weapon.is_tbc == true then
            -- Add item ID and quality color to weapon data
            local weaponWithId = {}
            for k, v in pairs(weapon) do
                weaponWithId[k] = v
            end
            weaponWithId.item_id = itemId
            weaponWithId.quality_color = qualityColors[weapon.quality] or qualityColors[0]
            table.insert(weapons, weaponWithId)
        end
    end
    return weapons
end

-- Function to get Classic weapons
function WeaponsDB:GetClassicWeapons()
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" and weapon.is_tbc == false then
            -- Add item ID and quality color to weapon data
            local weaponWithId = {}
            for k, v in pairs(weapon) do
                weaponWithId[k] = v
            end
            weaponWithId.item_id = itemId
            weaponWithId.quality_color = qualityColors[weapon.quality] or qualityColors[0]
            table.insert(weapons, weaponWithId)
        end
    end
    return weapons
end

-- Function to get weapons by level range
function WeaponsDB:GetWeaponsByLevelRange(minLevel, maxLevel)
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" and weapon.required_level >= minLevel and weapon.required_level <= maxLevel then
            -- Add item ID and quality color to weapon data
            local weaponWithId = {}
            for k, v in pairs(weapon) do
                weaponWithId[k] = v
            end
            weaponWithId.item_id = itemId
            weaponWithId.quality_color = qualityColors[weapon.quality] or qualityColors[0]
            table.insert(weapons, weaponWithId)
        end
    end
    return weapons
end

-- Random weapon functions
function WeaponsDB:GetRandomWeapon()
    local weapons = {}
    for itemId, weapon in pairs(self) do
        if type(weapon) == "table" then
            -- Add item ID and quality color to weapon data
            local weaponWithId = {}
            for k, v in pairs(weapon) do
                weaponWithId[k] = v
            end
            weaponWithId.item_id = itemId
            weaponWithId.quality_color = qualityColors[weapon.quality] or qualityColors[0]
            table.insert(weapons, weaponWithId)
        end
    end

    if #weapons == 0 then
        return nil
    end

    local randomIndex = math.random(1, #weapons)
    return weapons[randomIndex]
end

function WeaponsDB:GetRandomWeaponByQuality(quality)
    local weapons = self:GetWeaponsByQuality(quality)

    if #weapons == 0 then
        return nil
    end

    local randomIndex = math.random(1, #weapons)
    return weapons[randomIndex]
end

function WeaponsDB:GetRandomWeaponBySubclass(subclass)
    local weapons = self:GetWeaponsBySubclass(subclass)

    if #weapons == 0 then
        return nil
    end

    local randomIndex = math.random(1, #weapons)
    return weapons[randomIndex]
end

function WeaponsDB:GetRandomTBCWeapon()
    local weapons = self:GetTBCWeapons()

    if #weapons == 0 then
        return nil
    end

    local randomIndex = math.random(1, #weapons)
    return weapons[randomIndex]
end

function WeaponsDB:GetRandomClassicWeapon()
    local weapons = self:GetClassicWeapons()

    if #weapons == 0 then
        return nil
    end

    local randomIndex = math.random(1, #weapons)
    return weapons[randomIndex]
end

function WeaponsDB:GetRandomWeaponByLevelRange(minLevel, maxLevel)
    local weapons = self:GetWeaponsByLevelRange(minLevel, maxLevel)

    if #weapons == 0 then
        return nil
    end

    local randomIndex = math.random(1, #weapons)
    return weapons[randomIndex]
end

-- Make WeaponsDB globally available for WoW addons
_G.WeaponsDB = WeaponsDB
